import React from 'react';

const Home = () => {
  return (
    <div className="home-container">
      <div className="background-image">
        <div className="content">
          <p>DESIGNING</p>
          <h1>We Create Unique Architecture Design Ideas</h1>
          <button>Read More</button>
        </div>
      </div>
    </div>
  );
};

export default Home;
